export const initialItems = (res) => ({
  type: "INITIAL_ITEMS",
  items: res
})


export const loadInitialDataSocket = (socket, username, room) => {
  return (dispatch) => {
    let postData = {
      username: username,
      room: room
    }
    socket.emit('join', postData)
  }
}
